import{_ as a,c as s,o as t,ag as n}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"SET SESSION AUTHORIZATION","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/SET_SESSION_AUTHORIZATION.md","filePath":"docs/7x/ref_guide/sql_commands/SET_SESSION_AUTHORIZATION.md"}'),i={name:"docs/7x/ref_guide/sql_commands/SET_SESSION_AUTHORIZATION.md"};function o(r,e,l,p,c,d){return t(),s("div",null,e[0]||(e[0]=[n(`<h1 id="set-session-authorization" tabindex="-1">SET SESSION AUTHORIZATION <a class="header-anchor" href="#set-session-authorization" aria-label="Permalink to &quot;SET SESSION AUTHORIZATION&quot;">​</a></h1><p>Sets the session role identifier and the current role identifier of the current session.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SET [SESSION | LOCAL] SESSION AUTHORIZATION &lt;rolename&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>SET [SESSION | LOCAL] SESSION AUTHORIZATION DEFAULT</span></span>
<span class="line"><span></span></span>
<span class="line"><span>RESET SESSION AUTHORIZATION</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p>This command sets the session role identifier and the current role identifier of the current SQL-session context to be rolename. The role name may be written as either an identifier or a string literal. Using this command, it is possible, for example, to temporarily become an unprivileged user and later switch back to being a superuser.</p><p>The session role identifier is initially set to be the (possibly authenticated) role name provided by the client. The current role identifier is normally equal to the session user identifier, but may change temporarily in the context of <code>setuid</code> functions and similar mechanisms; it can also be changed by <a href="./SET_ROLE.html">SET ROLE</a>. The current user identifier is relevant for permission checking.</p><p>The session user identifier may be changed only if the initial session user (the authenticated user) had the superuser privilege. Otherwise, the command is accepted only if it specifies the authenticated user name.</p><p>The <code>DEFAULT</code> and <code>RESET</code> forms reset the session and current user identifiers to be the originally authenticated user name. These forms may be run by any user.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>SESSION : Specifies that the command takes effect for the current session. This is the default.</p><p>LOCAL : Specifies that the command takes effect for only the current transaction. After <code>COMMIT</code> or <code>ROLLBACK</code>, the session-level setting takes effect again. Note that <code>SET LOCAL</code> will appear to have no effect if it is run outside of a transaction.</p><p>rolename : The name of the role to assume.</p><p>NONE RESET : Reset the session and current role identifiers to be that of the role used to log in.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT SESSION_USER, CURRENT_USER;</span></span>
<span class="line"><span> session_user | current_user </span></span>
<span class="line"><span>--------------+--------------</span></span>
<span class="line"><span> peter        | peter</span></span>
<span class="line"><span></span></span>
<span class="line"><span>SET SESSION AUTHORIZATION &#39;paul&#39;;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>SELECT SESSION_USER, CURRENT_USER;</span></span>
<span class="line"><span> session_user | current_user </span></span>
<span class="line"><span>--------------+--------------</span></span>
<span class="line"><span> paul         | paul</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The SQL standard allows some other expressions to appear in place of the literal rolename, but these options are not important in practice. WarehousePG allows identifier syntax (rolename), which SQL does not. SQL does not allow this command during a transaction; WarehousePG does not make this restriction. The <code>SESSION</code> and <code>LOCAL</code> modifiers are a WarehousePG extension, as is the <code>RESET</code> syntax.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./SET_ROLE.html">SET ROLE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,21)]))}const S=a(i,[["render",o]]);export{u as __pageData,S as default};
